import React from "react";
import '../styles/utility-styles.css'
import '../styles/text-styles.css'
import { Col, Container, Row } from "react-bootstrap";
import Button from "react-bootstrap/Button";
import NavBar from "../components/NavBar";
import Footer from "../components/Footer";

const PersonalAccount = () => {
    return (
        <>
        <NavBar/>
        <Container fluid style={{width:'100vw', display:'flex', justifyContent:'center'}}>
            <Row>
                <Col>
                    <div  style={{justifyContent:'space-between'}}>
                        <div className="display-1">
                        Личный кабинет
                        </div>
                        <Button className='button-3 mt-4' style={{border:'none', width:'60%', fontSize:'16px', fontWeight:'700', marginRight:'3%'}}>
                            Войти
                        </Button>
                    </div>
                </Col>
            </Row>
        </Container>
        <Footer/>
        </>
    );
};

export default PersonalAccount;
